import React from 'react';
import Jogo from './Jogo';

const FaseEliminatoria = ({ fase, jogos, onAtualizarEstatisticas }) => {
  const handleSubmitScore = (placar, jogoIndex) => {
    // L贸gica para submeter o placar em jogos eliminat贸rios.
    onAtualizarEstatisticas({ jogoIndex, placar });
  };

  return (
    <div>
      <h2>{fase}</h2>
      {jogos.map(jogo => (
        <div key={jogo.jogoIndex}>
          <Jogo jogo={jogo} onSubmitScore={(placar) => handleSubmitScore(placar, jogo.jogoIndex)} />
        </div>
      ))}
    </div>
  );
};

export default FaseEliminatoria;
